import React from 'react';
import {Link} from 'react-router-dom';

import './currency-list-item.css';

const CurrencyListItem = ({data, onGetValue}) => {
	const elements = data.map((item) => {
		const {key, value} = item;

		return (
			<Link key={key} to="/">
				<li onClick={() => onGetValue(value)} className="currencyListItem">{key}</li>
			</Link>
		);
	});
	return (
		<React.Fragment>
			{elements}
		</React.Fragment>
	);
};

export default CurrencyListItem;
